// Import Libraries
import React, { useState } from "react";

const InputText = (props) => {
  const [data, setData] = useState({
    question: "",
  });

  const onChangeHandler = (val) => {
    setData({
      ...data,
      data: val,
    });
  };

  const onSubmitHandler = () => {
    console.log("works");
  };

  return (
    <div class="w-1/2 h-14 p-3 flex flex-row border-white border-2 bg-transparent rounded-md justify-items-start items-center">
      <i class="fas fa-search text-white m-2"></i>
      <input
        class="w-4/5 bg-transparent m-0 text-white rounded-xl focus:outline-none placeholder-custom-light-blue"
        type="search"
        placeholder={props.placeholder}
        onChange={(val) => onChangeHandler(val)}
        autoFocus={false}
      />
    </div>
  );
};

export default InputText;
